import React, { useState } from 'react'
import PropTypes from 'prop-types'
import './Navbar.css'


export default function Navbar(props) {

  const hamburger = () => {
    const hamB = document.querySelector(".bi-list");
    // const cross = document.querySelector(".bi-x-circle");
    if(hamB.contains === "bi-list"){
      classList.remove
    }
  }
  return (
    <>
    <div className="container">
      <div className="logo"><i className="bi bi-code"></i> HIMANSHU <i className="bi bi-code-slash"></i>
      </div>
      <nav className='Navbar'>
        <ul className=''>
          <li><i className="bi bi-house-door-fill"></i> <a href="/">{props.menu1}</a><p></p></li>
          <li><i className="bi bi-file-person"></i> <a href="/">{props.menu2}</a><p></p></li>
          <li><i className="bi bi-pc-display"></i> <a href="/">{props.menu3}</a><p></p></li>
        </ul>
        <i onClick={hamburger} className="bi bi-list bi-x-circle"></i>
        <i className="bi bi-x-circle"></i>
        <button><a href="/">Portfolio.</a></button>
      </nav>
    </div>
    </>
  )
}
Navbar.propTypes={
    title : PropTypes.string.isRequired,
    menu1 : PropTypes.string.isRequired,
    menu2 : PropTypes.string.isRequired,
    menu3 : PropTypes.string.isRequired
}
Navbar.defaultProps={
    title: 'Title Name',
    menu1: 'Menu',
    menu2: 'Menu',
    menu3: 'Menu'
}
